import React, { useState, useEffect } from 'react';
import styled from 'styled-components';
import { motion, AnimatePresence } from 'framer-motion';
import Header from './components/Header';
import Hero from './components/Hero';
import Skills from './components/Skills';
import Projects from './components/Projects';
import Experience from './components/Experience';
import Stats from './components/Stats';
import ProjectModal from './components/ProjectModal';
import { Project } from './types';

const AppContainer = styled.div`
  min-height: 100vh;
  background: linear-gradient(135deg, #667eea 0%, #764ba2 100%);
  position: relative;
  overflow-x: hidden;
`;

const MainContent = styled.main`
  position: relative;
  z-index: 1;
`;

const BackgroundPattern = styled.div`
  position: absolute;
  top: 0;
  left: 0;
  right: 0;
  bottom: 0;
  background-image: 
    radial-gradient(circle at 20% 80%, rgba(120, 119, 198, 0.3) 0%, transparent 50%),
    radial-gradient(circle at 80% 20%, rgba(255, 255, 255, 0.1) 0%, transparent 50%),
    radial-gradient(circle at 40% 40%, rgba(120, 119, 198, 0.2) 0%, transparent 50%);
  z-index: 0;
`;

function App() {
  const [selectedProject, setSelectedProject] = useState<Project | null>(null);
  const [projects, setProjects] = useState<Project[]>([]);
  const [loading, setLoading] = useState(true);

  useEffect(() => {
    // Simulate API call to Strapi
    const fetchProjects = async () => {
      try {
        // Mock data for now - replace with actual Strapi API call
        const mockProjects: Project[] = [
          {
            id: 1,
            title: "Sales Performance Dashboard",
            description: "Interactive dashboard analyzing quarterly sales performance with predictive analytics",
            image: "/api/placeholder/400/300",
            technologies: ["Power BI", "SQL", "Python", "Azure"],
            metrics: {
              views: 1250,
              impact: "15% increase in sales",
              duration: "3 months"
            },
            details: {
              challenge: "Company needed better visibility into sales performance and forecasting",
              solution: "Created comprehensive dashboard with real-time data integration and predictive models",
              results: "15% increase in sales, 30% reduction in reporting time, improved forecasting accuracy by 25%",
              technologies: ["Power BI", "SQL Server", "Python", "Azure Data Factory", "Machine Learning"],
              features: [
                "Real-time data visualization",
                "Predictive analytics models",
                "Automated report generation",
                "Mobile-responsive design",
                "Role-based access control"
              ]
            }
          },
          {
            id: 2,
            title: "Customer Churn Analysis",
            description: "Machine learning model to predict and prevent customer churn",
            image: "/api/placeholder/400/300",
            technologies: ["Python", "Scikit-learn", "Pandas", "Tableau"],
            metrics: {
              views: 890,
              impact: "22% reduction in churn",
              duration: "2 months"
            },
            details: {
              challenge: "High customer churn rate affecting business growth",
              solution: "Developed ML model to identify at-risk customers and implemented targeted retention strategies",
              results: "22% reduction in customer churn, $2M in retained revenue, improved customer satisfaction scores",
              technologies: ["Python", "Scikit-learn", "Pandas", "NumPy", "Tableau", "PostgreSQL"],
              features: [
                "Churn prediction model (85% accuracy)",
                "Customer segmentation analysis",
                "Automated alert system",
                "Retention campaign recommendations",
                "Performance monitoring dashboard"
              ]
            }
          },
          {
            id: 3,
            title: "Supply Chain Optimization",
            description: "Data-driven approach to optimize inventory and reduce costs",
            image: "/api/placeholder/400/300",
            technologies: ["R", "Shiny", "SQL", "Excel"],
            metrics: {
              views: 1100,
              impact: "18% cost reduction",
              duration: "4 months"
            },
            details: {
              challenge: "Inefficient inventory management leading to high costs and stockouts",
              solution: "Analyzed supply chain data to optimize inventory levels and improve demand forecasting",
              results: "18% reduction in inventory costs, 40% reduction in stockouts, improved supplier relationships",
              technologies: ["R", "Shiny", "SQL", "Excel", "VBA", "SAP"],
              features: [
                "Demand forecasting models",
                "Inventory optimization algorithms",
                "Supplier performance tracking",
                "Cost analysis tools",
                "Automated reporting system"
              ]
            }
          }
        ];
        
        setProjects(mockProjects);
        setLoading(false);
      } catch (error) {
        console.error('Error fetching projects:', error);
        setLoading(false);
      }
    };

    fetchProjects();
  }, []);

  return (
    <AppContainer>
      <BackgroundPattern />
      <MainContent>
        <Header />
        <Hero />
        <Stats />
        <Skills />
        <Experience />
        <Projects 
          projects={projects} 
          onProjectSelect={setSelectedProject}
          loading={loading}
        />
      </MainContent>
      
      <AnimatePresence>
        {selectedProject && (
          <ProjectModal
            project={selectedProject}
            onClose={() => setSelectedProject(null)}
          />
        )}
      </AnimatePresence>
    </AppContainer>
  );
}

export default App;
